import React from 'react';

function Welcome() {
	return (
		<div className="welcome-div">
			<h2 className="welcome-h2">
				<span>w</span>
				<span>e</span>
				<span>l</span>
				<span>c</span>
				<span>o</span>
				<span>m</span>
				<span>e</span>
				<span> </span>
				<span>!</span>
			</h2>
		</div>
	);
}

export default Welcome;
